import React from 'react';
import theme from './Theme';

function Footer() {
  const classes = useStyles();

  return (
    <footer className={classes.footer}>
      <div>
        <p>&copy; {new Date().getFullYear()} Your Website Name</p>
        <p>Contact: your@email.com</p>
      </div>
    </footer>
  );
}

export default Footer;
